import React from 'react';
import s from './Dialogs.module.css';
import { NavLink } from "react-router-dom";


const DialogItems = (props) => {

    let path = /dialogs/ + props.id;

    return(
        <div className={s.dialog + ' ' + s.active}>
                   <NavLink to={path}>{props.name}</NavLink>
                </div>
    )
}

const Dialogs = (props) => {
    return (
        <div className={s.dialogs}>
            <div className={s.dialogsItems}>
                <DialogItems name='Sveta' id='11'/>
                <DialogItems name='Sveta' id='21'/>
                <DialogItems name='Sveta' id='31'/>
                <DialogItems name='Sveta' id='41'/>
                <DialogItems name='Sveta' id='5'/>
                <DialogItems name='Sveta' id='6'/>
                <div className={s.dialog}>
                    <NavLink to='/dialogs/2'>Nastya</NavLink>
                </div>
                <div className={s.dialog}>
                    <NavLink to='/dialogs/3'>Dasha</NavLink>
                </div>
                <div className={s.dialog}>
                    <NavLink to='/dialogs/4'>Anna</NavLink>
                </div>
                <div className={s.dialog}>
                    <NavLink to='/dialogs/5'>Ahmed</NavLink>
                </div>
            </div>
            <div className={s.messages}>
                <div className={s.message}>Hello!!!</div>
                <div className={s.message}>What are you doing?</div>
                <div className={s.message}>Yes, i am too.</div>
            </div>
        </div>
    )
}

export default Dialogs;
